import React from 'react';
import { Link, Route, Switch } from 'react-router-dom';
import Banner from '../../components/Banner/Banner';
import Card from '../../components/Card/Card';
import NotFound from '../NotFound/NotFound';
import bannerImage from '../../assets/images/Banner1.png';
import logementsData from '../../assets/logements.json';
import FicheLogement from '../Fiche-Logement';

const Home = () => {
  const cardData = logementsData.slice(0, 6).map(item => ({
    id: item.id,
    title: item.title,
    image: item.cover
  }));

  return (
    <main>
      <Banner title="Chez vous, partout et ailleurs" image={bannerImage} />
      <div className="home-content">
        <div className="cards-container">
          {cardData.map(card => (
            <Link key={card.id} to={`/Fiche-Logement/${card.id}`}>
              <Card title={card.title} image={card.image} />
            </Link>
          ))}
        </div>
      </div>
      <Switch>
        <Route path="/Fiche-Logement/:id" exact>
          <FicheLogement />
        </Route>
        <Route path="/">
          {/* Ovdje renderujte sadržaj vaše početne stranice */}
        </Route>
        <Route path="*">
          <NotFound />
        </Route>
      </Switch>
    </main>
  );
};

export default Home;
